  input: TEXT,F3A,,"Pursuant to the Commissions letter of February 10, 2004 this amendment
    is filed to correct the amounts disclosed on Form 3Z-1 Line 1 and Line 2.  In
    the same letter the Commission referred to  the Committee's 'best efforts' to
    provide all information that is required for contributors.  The original solicitation
    includes a clear and conspicuous request for the contributor information and informs
    the contributor of the federal law requirements for reporting such information.  If
    the information is not provided, the Committee requests the missing information
    via telephone call or mail within 30 days of receipt of the contribution.  The
    follow-up clearly asks for the missing information and does not solicit an additional
    contribution.  It informs the contributor of the requirement of the federal law
    for reporting of such information; and if the request is via mail, a pre-addressed
    return envelope is included.  Lastly, if contributor information is received the
    previously filed reports are amended or an amended Schedule A is filed with the
    next regularly scheduled report.  Also, the purpose fields have been corrected
    as requested.  Consulting is for political consulting."
